const Subject = () => {
    return (
        <div>
            <h1>Over Nederland Stemt</h1>
            <p>Welkom op Nederland Stemt! De stem pagina van het land!
            Klik op een onderwerp om een stem uit te brengen.
            </p>
        </div>
    );

};

// Dit bevat een lijst met webpagina's welke leiden tot een stem pagina van het gekozen onderwerp.
